> Top News Sanders pulls in nearly as much cash this quarter as Clinton In this Sept. 28, 2015 photo, Democratic presidential candidate Sen. Bernie Sanders, I-Vt. speaks at the University of Chicago in Chicago. Sanders raised about $26 million for his presidential campaign in the past three months, his campaign said Wednesday, nearly matching the $28 million take of Democratic front-runner Hillary Rodham Clinton. (AP Photo/Paul Beaty) 
